import logo from "./logo.svg";
import "./App.css";
import HomeScreen from "./Components/homeScreen/HomeScreen";
import Login from "./Components/login/Login";
import { Route, Routes } from "react-router-dom";
function App() {
  return (
    <>
      <div className="App">
        <div>
        <Login/>
          <HomeScreen/>
        </div>
      </div>
    </>
  );
}

export default App;
